Идентификатор на лиценз, представляващ уникален глобален идентификатор за лиценз или договор, под който артикулите са генерирани, подадени за обработка и/или платени, който се конструира чрез конкатениране на:
 - код на издаваща агенция по ISO/IEC 15459;
 - номер на лиценз или договор, който отговаря на спецификациите на съответната издаваща агенция;
 и който:
 - съдържа само главни букви от азбуката и/или цифри;
 - е уникален (тоест, се различава от всеки друг идентификатор, съответстващ на ISO/IEC 15459) в рамките на домейна на издаващата агенция;
 - не може да бъде произведен от друг идентификатор, съответстващ на ISO/IEC 15459, издаден под същата издаваща агенция, чрез просто добавяне на символи към неговия край или тяхното премахване.

Код на риболовна зона на ФАО, дефиниран от Отдела за рибарство и аквакултури на ФАО (http://www.fao.org. Търсене за подсайт на Fishing Area Code).
Всички символи от подмножеството на GS1 General Specification, дефинирано от ISO/IEC 646 са разрешени.
Примери:
18L37.1.3 Западно Средиземноморие, Сардиния;
18L47.B.1 Атлантик, Югоизточен, SEAFO Division, Namibia EEZ;
18L67 Тихия океан, Североизток.

'26L' Код на местоположение, представляващ код, идентифициращ местоположение или географска област, или свързана група от такива местоположения или области, които имат значение за свързана транзакция и които отговарят на една от структурите, дефинирани в (а) до (f) по-долу:
a) две главни букви, съответстващи на двубуквения ISO 3166-1 код на държавата, в която се намират, или се състои от местоположенията или областите;
b) три главни букви, съответстващи на IATA кода на летището или града, в който, близо до който, или от който се състоят местоположенията или областите;
c) четири или повече символа, като първите три съответстват на ISO 3166-1 код на държава, последван от дефис (-), останалата част е пощенски код в съответната държава;
d) четири или повече символа, като първите три съответстват на ISO 3166-1 код на държава, последван от точка (.), останалата част е ISO 3166-2 код на подразделение на държавата в съответната държава;
e) пет главни букви, съответстващи на UN/LOCODE на областта, в която, близо до която, или от която се състоят местоположенията или областите;
f) конкатенация, с дължина не по-малко от седем и не повече от 35 символа, от:
- код на издаваща агенция по ISO/IEC 15459;
- код на местоположение, състоящ се от символи, извлечени от набора {A-Z; 0-9}, който отговаря на спецификациите на съответната издаваща агенция.

Местоположение на събитие UN/LOCODE.
UN/LOCODE, последван от символ плюс (+), последван от един или повече кодове от списъка с кодове EDIFACT Code List 3227 'Location function code qualifier', напр.,
7 Място на окончателна доставка;
5 Порт на заминаване;
9 Порт на натоварване;
11 Порт на разтоварване;
13 Място за претоварване;
24 Порт на влизане;
35 Държава на износ;
88 Място за получаване от превозвача;
125 Чуждестранен порт преди заминаване за САЩ;
147 Място за съхранение/позиция;
159 Място за доставка (до получателя);
248 Място за натоварване
http://www.unece.org/cefact/locode/.

