Идентификатор на оборудване, представляващ уникален глобален идентификатор за устройство, оборудване или инстанция на компютърно приложение, използвано в производството, транспорта, обработката или друго обслужване на артикули, който се конструира чрез конкатениране на:
 - код на издаваща агенция по ISO/IEC 15459;
 - номер на оборудването, който отговаря на спецификациите на съответната издаваща агенция; и който:
 - съдържа само главни букви от азбуката и/или цифри;
 - е уникален (тоест, се различава от всеки друг идентификатор, съответстващ на ISO/IEC 15459) в рамките на домейна на издаващата агенция;
 - не може да бъде от друг идентификатор, съответстващ на ISO/IEC 15459, издаден под същата издаваща агенция, чрез просто добавяне на символи към неговия край или техните премахване от него.
Идентификатор на четец.
Идентификатор на оборудване, представляващ уникален глобален идентификатор за устройство, оборудване или инстанция на компютърно приложение, използвано в производството, транспорта, обработката или друго обслужване на артикули.

Код на UPU местоположение, представляващ код, идентифициращ местоположение или географска област, или свързана група от такива местоположения или области, които имат значение за свързана транзакция и които съответстват на една от структурите, дефинирани в а) до г) по-долу:
a) два главни алфабетни символа, съответстващи на двубуквения код на ISO 3166-1 на държавата, в която се намира или се състои от местоположението(ите) или област(ите);
b) три главни алфабетни символа, съответстващи на кода на IATA на летището или града в, близо до или състоящ се от местоположението(ите) или област(ите);
c) четири или повече символи, от които първите три съответстват на код на държава по ISO 3166-1, последвани от тире (-), с остатъка, бидейки пощенски код в съответната държава;
d) четири или повече символи, от които първите три съответстват на код на държава по ISO 3166-1, последвани от точка (.), с остатъка, бидейки код на административно подразделение по ISO 3166-2 в съответната държава;
e) пет главни алфабетни символа, съответстващи на кода на UN/LOCODE на областта в, близо до или състояща се от местоположението(ите) или област(ите);
f) шест главни алфанумерични символа, съответстващи на кода на UPU IMPC, разпределен в съответствие със стандарта на UPU S34;
g) конкатенация, бидейки не по-малко от седем и не повече от 25 символа на дължина, от:
 - код на издател, разпределен в съответствие със стандартите на UPU S31;
 - код на местоположение, състоящ се от символи, взети от набора {A-Z; 0-9}, който съответства на спецификациите на съответния издател.

Регистрационен номер с данни за услугата и код на местоположение е сложна даннова конструкция, съответстваща на спецификацията в стандарта на UPU S25, която включва спецификация на:
 - идентификатор на артикул, съответстващ на ISO/IEC 15459;
 - идентификатор на данни 5U, съответстващ на спецификацията на услугата, която трябва да бъде предоставена във връзка с артикула;
 - идентификатор на данни 17U, съответстващ на код на местоположение на UPU или идентификатор на данни 18U, съответстващ на квалифициран код на местоположение на UPU.
 Забележка - За повече подробности, моля, вижте стандарта на UPU S25. Разликата между прост код на местоположение на UPU (DI 17U) и квалифициран код на местоположение на UPU (DI 18U) може да бъде определена от първия символ. Ако той е числов, прилага се 18U; ако е буквен, прилага се 17U.

