Дата, представена в модифицирана форма, съвместима с UTC:
yyyy[mm[dd[hh[mm[ss[fff]]]]]][poooo] където квадратните скоби показват опционалност и yyyy е годината, mmdd месецът и денят, hhmmss времето на деня в часове минути и секунди, fff дробите на секундите и poooo отместването от UTC, изразено в часове и минути, отместването е положително, ако p е точка (.), отрицателно, ако P е минус знак (-).
ПРИМЕР:
2005 - (UTC) календарна година 2005;
200505 - (UTC) календарен месец май 2005;
20050518 - (UTC) 18 май 2005;
200505181247 - 12:47 UTC на 18 май 2005;
200505181247.0100 - 12:47 местно време, бидейки 11:47 UTC, на 18 май 2005;
20050518124723099 - 99 милисекунди след 12:47:23 UTC на 18 май 2005.

Квалифицирана дата, състояща се от конкатенация на:
- код на издаваща агенция ISO/IEC 15459;
- квалификатор на дата, съответстващ на спецификациите на тази издаваща агенция;
- дата, чийто формат и тълкуване съответстват на спецификациите на издаващата агенция за този квалификатор на дата.

Декларация за категория на опаковъчния материал*, Код* и Тегло за даден опаковъчен материал, използван в дадена опаковка в съответствие с директивата на ЕС за опаковките и отпадъците от опаковки. (Категория на материала и код, дефинирани в Приложение M).
12ECCMMMMMMNNNNNUU където: - '12E' (an3) е Идентификатор на данни;
 - 'CC' (n2) е Категория на материала според Приложение M;
 - 'MMMMMM' (an1...6) е Код на материала според Приложение M;
 - 'NNNNN' (n5) Тегло на материала, включително десетичната точка (например, 12.12);
 - 'UU' (an2) е Мерна единица за тегло (например, KG, GR, LB или OZ според ANSI X12.3 както в Приложение D).

Име на страна.
Име на страна, последвано от плюс (+) символ, последвано от една или повече кодови стойности от списъка с кодове на EDIFACT 3035 'Квалификатор на страна', например;
BY [Купувач];
CF [Оператор на контейнер];
CN [Получател];
CS [Консолидатор];
DEI [Оператор на кораб/капитан на кораб];
FA [Код на оперативен персонал];
IM [Вносител];
MF [Производител];
OS [Изпращач];
SE [Продавач];
ST [Доставка до];
UC [Краен получател].

Номер на получателя.
Уникалният идентифициращ номер може да бъде IRS, EIN, SSN или номерът, присвоен от CBP, както е изисквано в Декларацията за сигурност. Само следните формати трябва да бъдат използвани: IRS EIN: NN-NNNNNNN;
IRS EIN със суфикс:
NN-NNNNNNNXX;
SSN: NNN-NN-NNNN;
CBP присвоен nbr: YYDDPP-NNNNN.
